import React from 'react';
import ReactDOM from 'react-dom';
import Nav,{Card} from "./cards";
import Img0 from "./lis.jpg";
import Img1 from "./str.jpeg";
import Img2 from "./for.jpg";
ReactDOM.render(<>
    <Nav/>
    <div className="ashu">
    <Card imgsrc={Img0} link="https://www.netflix.com/in/title/80104198" name="Lost in space"/>
    <Card imgsrc={Img1} link="https://www.netflix.com/in/title/80057281" name="Stranger things"/>
    <Card imgsrc={Img2} link="https://www.amazon.com/Forever-The-Complete-First-Season/dp/B00NG1SC3C" name="Forever"/>
    <Card imgsrc={Img2} link="https://www.amazon.com/Forever-The-Complete-First-Season/dp/B00NG1SC3C" name="Forever"/>
    <Card imgsrc={Img2} link="https://www.amazon.com/Forever-The-Complete-First-Season/dp/B00NG1SC3C" name="Forever"/>


    </div>
    </>,document.getElementById("root"));

